description:
【リンメル ピュアナチュラル ブライトスキン ベースの詳細】<br>●オーガニック植物抽出成分・ミネラルクレイ配合。<br>●みずみずしいのび広がりで自然になじみ、肌にしっかりフィット。水の中に油が点在しているベースにべたつきの少ない油剤を配合することで、みずみずしくなめらかなのび広がりを実現。また、リン脂質でコートされた粉体が肌にピタッと密着。<br>●毛穴や色ムラ、赤味など気になる部分を自然にカバー。<br>●ほんのり血色をあたえるピーチカラー。<br>●高い保湿効果とうるおい持続効果。<br>●アレルギーテスト済み、ノンコメドジェニックテスト済み。<br>●SPF24　PA++。<br><br>【使用方法】<br>指先に適量とり、少量ずつ肌にムラなく均一にのばします。<br>※肌表面がサラリとしてからファンデーションをつけるとより美しく仕上がります。<br><br>【ご注意】<br>○つけすぎは、ファンデーションがムラにつく原因になりますのでご注意ください。<br>○ご使用後は、キャップをきちんと閉めてください。<br>○傷やはれもの・湿疹等、お肌に異常のある時はお使いにならないでください。<br>○使用中、赤み・はれ・かゆみ・刺激等の異常があらわれた場合は、使用を中止し、皮膚科専門医等へご相談ください。そのまま使用を続けますと症状が悪化することがあります。<br>○他の紫外線防止効果のある化粧品と併用するとより効果的です。<br><br>【成分】<br>水、BG、トリエチルヘキサノイン、シクロメチコン、DPG、メトキシケイヒ酸エチルヘキシル、エタノール、ステアリン酸、ジエチルアミノヒドロキシベンゾイル安息香酸ヘキシル、オリーブ油、トウキンセンカ花エキス、ローズマリーエキス、BHT、PEG-10水添ヒマシ油、PEG-60水添ヒマシ油、TEA、(アクリル酸／アクリル酸アルキル(C10-30))コポリマー、(ジメチコン／ビニルジメチコン)クロスポリマー、イソステアリン酸ポリグリセリル-2、キサンタンガム、シリカ、ステアリン酸グリセリル(SE)、セテアリルアルコール、タナクラクレイ、タルク、トリセテアレス-4リン酸、ナイロン-12、ヒドロキシプロピルメチルセルロース、ベヘニルアルコール、ペンテト酸5Na、ラウロイルグルタミン酸ジ(フィトステリル／オクチルドデシル)、レシチン、ワセリン、水添レシチン、フェノキシエタノール、(+／-)、酸化チタン、酸化鉄、水酸化AL<br><br>【内容量】<br>30g<br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>株式会社コスメ ラボ<br>東京都中央区銀座3-5-12<br>0120-878-653<br><br>【商品区分】<br>化粧品<br><br>［RIMMEL 化粧下地］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
