【セザンヌ 皮脂テカリ防止下地 ピンクベージュの詳細】<br>
●皮脂テカリを防ぐ： メイク崩れの原因となる皮脂を吸収。べたつかず、さらさらの感触でファンデーションの美しい仕上がりが続きます。化粧もち持続成分（ロングラスティング成分）配合。<br>
●毛穴目立ちにくい： 皮脂吸着パウダーが毛穴の凹凸をカバーし、さらに光拡散効果で目立たせません。<br>
●ウォータープルーフ： 水・汗に崩れにくい処方。<br>
●ピンクベージュカラー： 顔色がさりげなく明るくなるような、ピンクベージュカラー。白浮せず、自然にトーンアップします。<br>
●SPF28・PA++/紫外線吸収剤不使用/無香料<br><br>

【使用方法】<br>
容器をよく振ってからお使いください。ファンデーションをつける前に適量をとり、顔全体にムラにならないように薄くのばして、よくなじませてください。<br><br>

【成分】<br>
シクロペンタシロキサン、水、酸化亜鉛、BG、酸化チタン、PEG-9ポリジメチルシロキシエチルジメチコン、ジメチコン、PEG-10ジメチコン、シリカ、トリフルオロアルキルジメチルトリメチルシロキシケイ酸、アセチルヒアルロン酸Na、ローマカミツレ花油、セージ葉エキス、トコフェロール、グリチルリチン酸2K、水添ポリイソブテン、ポリメチルシルセスキオキサン、ヒドロキシプロピルシクロデキストリン、水酸化AL、ハイドロゲンジメチコン、酸化鉄、ノバラ油、エチルヘキシルグリセリン、ブチルカルバミン酸ヨウ化プロピニル<br><br>

【内容量】<br>
30ml<br><br>

【販売元】<br>
セザンヌ化粧品<br>
